				+'			<span class="' + UID['doa-icons'] + ' i-' + unit_type + '"></span>'
				+'		</td>'
				+'		<td>'
				+'		<input type=text id=' + setUID('Tabs.Jobs.tabTrain.units_' + city_idx + '_' + i) + ' ref=' + city_idx + '_' + unit_type +' maxlength=6 size=6 value="' + unit_quantity + '" style="text-align:right;" />'
